import React from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import Login from './components/Login';
import Register from './components/Register';
import AdminLogin from './components/AdminLogin';
import AdminDashboard from './components/AdminDashboard';
import ParentDashboard from './components/ParentDashboard';
import TeacherDashboard from './components/TeacherDashboard';
import ManagerDashboard from './components/ManagerDashboard';
import HeroSection from './components/HeroSection';
import PrivateRoute from './components/PrivateRoute';

function App() {
  // Vérifier si l'utilisateur est connecté avec un token valide
  const isAuthenticated = () => {
    try {
      const token = localStorage.getItem('token');
      const userStr = localStorage.getItem('user');

      console.log('Vérification authentification:', {
        hasToken: !!token,
        hasUserStr: !!userStr,
        userStr: userStr
      });

      if (!token || !userStr) {
        console.log('Non authentifié: token ou userStr manquant');
        return false;
      }

      const user = JSON.parse(userStr);
      console.log('User parsé:', user);

      const isValid = !!(user && user.role);
      console.log('Est authentifié:', isValid);

      return isValid;

    } catch (error) {
      console.error('Erreur de vérification d\'authentification:', error);
      localStorage.clear(); // Nettoyer tout le localStorage en cas d'erreur
      return false;
    }
  };

  // Obtenir le rôle de l'utilisateur
  const getUserRole = () => {
    try {
      const userStr = localStorage.getItem('user');
      if (!userStr) return null;
      const user = JSON.parse(userStr);
      return user.role;
    } catch {
      return null;
    }
  };

  // Ajouter cette fonction
  const clearStorage = () => {
    localStorage.clear();
    window.location.reload();
  };

  return (
    <Router>
      <div className="min-h-screen bg-gray-100">
        {/* Ajouter ce bouton temporairement pour déboguer */}
        <button 
          onClick={clearStorage}
          style={{
            position: 'fixed',
            top: '10px',
            right: '10px',
            zIndex: 9999,
            padding: '5px',
            background: 'red',
            color: 'white'
          }}
        >
          Clear Storage
        </button>

        <Routes>
          {/* Routes publiques */}
          <Route path="/" element={
            isAuthenticated() ? 
            <Navigate to={`/${getUserRole()}/dashboard`} replace /> : 
            <HeroSection />
          } />

          <Route path="/login" element={
            isAuthenticated() ? 
            <Navigate to={`/${getUserRole()}/dashboard`} replace /> : 
            <Login />
          } />

          <Route path="/register" element={
            isAuthenticated() ? 
            <Navigate to={`/${getUserRole()}/dashboard`} replace /> : 
            <Register />
          } />

          <Route path="/admin/login" element={
            isAuthenticated() && getUserRole() === 'admin' ? 
            <Navigate to="/admin/dashboard" replace /> : 
            <AdminLogin />
          } />

          {/* Routes protégées */}
          <Route path="/admin/dashboard/*" element={
            <PrivateRoute>
              <AdminDashboard />
            </PrivateRoute>
          } />

          <Route path="/parent/dashboard/*" element={
            <PrivateRoute>
              <ParentDashboard />
            </PrivateRoute>
          } />

          <Route path="/teacher/dashboard/*" element={
            <PrivateRoute>
              <TeacherDashboard />
            </PrivateRoute>
          } />

          <Route path="/manager/dashboard/*" element={
            <PrivateRoute>
              <ManagerDashboard />
            </PrivateRoute>
          } />

          {/* Redirection par défaut */}
          <Route path="*" element={
            isAuthenticated() ? 
            <Navigate to={`/${getUserRole()}/dashboard`} replace /> : 
            <Navigate to="/" replace />
          } />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
